Messenger.sol is an application contract on EVM capable of communicating with the Wormhole core bridge. Start by hard coding the Wormhole core bridge address, and creating a interfaced link to it. //SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.0; import "./Wormhole/IWormhole.sol"; contract Messenger { string private current_msg; address private wormhole_core_bridge_address = address(0xC89Ce4735882C9F0f0FE26686c53074E09B0D550); IWormhole core_bridge = IWormhole(wormhole_core_bridge_address); // Used to calculate the Sequence for each message sent from this contract uint32 nonce = 0; // Chain ID => Application Contract mapping to ensure we only process messages from contracts we want to. mapping(uint16 => bytes32) _applicationContracts; address owner; // Track which messages we've already processed so we don't double process messages. mapping(bytes32 => bool) _completedMessages;
}

