It's typically a good idea to register and track the contracts from foreign chains that you're accepting VAAs from, as anyone could deploy a contract and generate a fake VAA that looks like a real VAA you'd want to accept. /** Registers it's sibling applications on other chains as the only ones that can send this instance messages */
function registerApplicationContracts(uint16 chainId, bytes32 applicationAddr) public { require(msg.sender == owner, "Only owner can register new chains!"); _applicationContracts[chainId] = applicationAddr;
}
